import React from 'react';
import { FlatList, Text, TouchableOpacity, View } from 'react-native';
import { heightPercentageToDP as hp, widthPercentageToDP as wp } from 'react-native-responsive-screen';
import FAIcon from 'react-native-vector-icons/FontAwesome';
import { connect } from 'react-redux';
import { MowButtonBasic } from '../../components/ui/Common/Button/MowButton';
import MowContainer from '../../components/ui/Core/Container/MowContainer';
import { MowInfoHeader } from '../../components/ui/MowInfoHeader';
import { PaymentMethodController } from '../../controller/paymentMethod.controller';
import { OrderController } from '../../controller/order.controller';
import { mowColors } from '../../values/Colors/MowColors';
import { fontFamily } from '../../values/Styles/MowStyles';
import { setPaymentMethod } from '../../store/actions/orderActions';
import { setCartEmpty } from '../../store/actions/productActions';
import { _confirmOrder } from '../../components/ui/Common/Dialog/MowDialogFunctions';

interface IProps {
    user: any;
    product: any;
    navigation: any;
    order: any;
    setPaymentMethod(data): any;
    setCartEmpty(): any;

}

interface IState {
    selected: any;
    datas: any[];
}

class PaymentMethodScreen extends React.Component<IProps, IState> {

    _unsubscribe = null;
    modelController = new PaymentMethodController();
    orderController = new OrderController();

    constructor(props) {
        super(props);

        this.state = {
            selected: null,
            datas: [],
        };
    }

    componentDidMount() {
        this._unsubscribe = this.props.navigation.addListener('focus', () => {
            this.getData();
        });
    }

    getData = () => {
        this.modelController.getAll({ take: 'all' })
            .subscribe((result: any) => {
                const data = result.data;
                this.setState({ datas: data.data, selected: data.data[0] });
            });
    }

    onSelect = (item) => {
        this.setState({ selected: item });
    }

    isSelected = (item) => {
        const { selected } = this.state;
        if (selected.uuid === item.uuid) {
            return true;
        } else {
            return false;
        }
    }

    componentWillUnmount() {
        this._unsubscribe();
    }

    placeOrder = (payload) => {
        this.orderController.createOrder(payload)
            .subscribe((result: any) => {
                const data = result.data;
                this.props.setCartEmpty();
                this.props.navigation.navigate('Orders');
            });
    }

    onConfirmButtonClick = () => {
        const payload = {
            billingInfo: this.props.order.billingAddress,
            shippingInfo: this.props.order.shippingAddress,
            shippingArea: this.props.order.shippingArea,
            customer: this.props.user.user,
            orderOptions: {
                deliveryTiming: this.props.order.deliveryTiming,
                paymentMethod: this.state.selected,
            },
            cart: { products: [] },
            coupon: this.props.product.activatedCoupon,
        };

        this.props.product.cart.map(o => {
            const ob = {
                quantity: o.quantity,
                data: o.product,
            };
            payload.cart.products.push(ob);
        });

        _confirmOrder(() => this.placeOrder(payload));
    }

    render() {
        return (
            <MowContainer
                navigation={this.props.navigation}
                style={{ backgroundColor: mowColors.pageBGDarkColor }}
                title={'Payment Method'}>
                {
                    this.props.product.cart.length > 0 ?
                        <MowInfoHeader
                            activeIndex={4} /> : null
                }

                {
                    this.state.datas.length > 0 ?
                        <FlatList
                            showsVerticalScrollIndicator={false}
                            keyExtractor={(item, index) => index.toString()}
                            data={this.state.datas}
                            style={{ marginTop: 10 }}
                            renderItem={({ item, index }) => (
                                <TouchableOpacity
                                    onPress={() => { this.setState({ selected: item }); }}
                                    style={{
                                        marginTop: 20,
                                        flexDirection: 'row',
                                        padding: 10,
                                        borderRadius: 5,
                                        marginHorizontal: wp('4%'),
                                        backgroundColor: 'white',
                                        borderStyle: 'solid',
                                        borderWidth: 1,
                                        borderColor: 'rgba(146, 146, 146, 0.41)',
                                        marginVertical: 5,
                                    }}>
                                    <View
                                        style={{ width: '90%' }}>
                                        <Text
                                            style={{
                                                fontSize: hp('2%'),
                                                fontStyle: 'normal',
                                                color: mowColors.textColor,
                                                fontWeight: '600',
                                                paddingLeft: 10,
                                                fontFamily: fontFamily.regular,
                                            }}>
                                            {item.name}
                                        </Text>
                                    </View>
                                    <View
                                        style={{ width: '10%' }}>
                                        <FAIcon
                                            style={{
                                                fontSize: hp('2.5%'),
                                                color: this.isSelected(item) ? mowColors.mainColor : '#b4b4b4',
                                            }}
                                            name={this.isSelected(item) ? 'circle' : 'circle-thin'} />

                                    </View>

                                </TouchableOpacity>

                            )}
                        /> : null
                }

                {
                    this.state.selected !== null ?
                        <View
                            style={{ margin: 10 }}>
                            <MowButtonBasic
                                onPress={this.onConfirmButtonClick}
                                type={'success'}>
                                Confirm Order
                            </MowButtonBasic>
                        </View> : null
                }

            </MowContainer>
        );
    }
}

const mapStateToProps = (state) => {
    const { user, product, order } = state;
    return { user, product, order };
};
const mapDispatchToProps = {
    setPaymentMethod: setPaymentMethod,
    setCartEmpty: setCartEmpty,
};
export default connect(mapStateToProps, mapDispatchToProps)(PaymentMethodScreen);
